        <Text>
            Profile Image HERE <br></br>
            Name <br></br>
            Username <br></br>
            Age <br></br>
            Preffered Play Style <br></br>
            Favorite Game <br></br>
            LIST GAME CATEGORIES HERE <br></br>
            Change Account Details Button Here <br></br>
            Log out Button Here
            </Text>
        </View>
    )
}
